import { dialogBackgroundStyle } from "../Styles/StyleFunctions";

export default function AlbumSearchComponent ({openSearch,setOpenSearch,album,setAlbum}) {
    return (
        <div style = {{
             visibility: openSearch ? 'visible' : 'hidden'
            }}>
            <div style = {dialogBackgroundStyle()}>
                <div>
                    <input placeholder="Search for an album..."></input>
                </div>
            <button onClick = {() => setOpenSearch(false)}>
            Close
            </button>    
            </div>
        </div>
    )
}
